							j++;
							current_frame = 0;
							total_frames = 5 + Math.floor(Math.random() * 20);
						}
						var data = $('#myobj').html();
						$.post('/postImg/' + frame, {
							data : data
						}, draw);
					}
				};

				init();
				draw();
				$('#myobj').show();
				$.rerun = function() {
					var old = document.getElementsByTagName('div')[0];
					old.parentNode.removeChild(old);
					document.getElementsByTagName('body')[0].appendChild(myobj);
					init();
					draw();
				};
			});
		</script>
	</body>
</html>
